// 保存图片
function save_img(w,h,el,ajax_url){
    var scale_w = parseFloat(w/h);
    var el = el;
    scale_w = scale_w.toFixed(1);
    scale = scale_w+'/1';
    bind_CropAvatar(scale, function(){
        var image_url = $("input[name='"+el+"']").val();
		if(!image_url){
			return;
		}
        var data = {};
        data[el] = image_url;
        handleAjax.handle(ajax_url,data).done(function(msg){
            $.showSuccess(msg);
        }).fail(function(err){
            $.showErr(err);
        });
    });
}
